def migratoryBirds(arr):

    birds = OrderedDict()
    bird_type = None

    arr.sort()
    for i in arr:
        if i not in birds:
            birds[i] = 1
        else:
            birds[i] += 1

    max_val = max(birds.values())
    print(birds, max_val)
    for k, v in birds.items():
        if v == max_val:
            bird_type = k
            break

    return bird_type

print(migratoryBirds([1,1,2,2,3]))
print(migratoryBirds([1,4,4,4,5,3]))
print(migratoryBirds([1,2,3,4,5,4,3,2,1,3,4]))

